import React from "react";
import "./app-header.css"
const AppHeader = () =>{

    return(
        <div className="container">
            <div className="row">
                <div className="col-sm">
                    <h1>My Todo List</h1>

                </div>

                <div className="how_much_done">
                    1 more to do, 3 done
                </div>
            </div>


        </div>


    )
}

export default AppHeader;
